import React from 'react';
import './BillTable.css'; 

const BillTable = ({ data }) => {
    return (
        <div className="table-container">
            <table className="bill-table">
                <thead>
                    <tr>
                        <th>Bill</th>
                        <th>Bill Number</th>
                        <th>Congressional Year</th>
                        <th>Update Date</th>
                        <th>Update</th>
                    </tr>
                </thead>
                <tbody>
                    {data.map((item, index) => (
                        <tr key={index}>
                            <td>
                                <a href={`/bill/${index}`} style={{ textDecoration: 'none', color: 'inherit' }}>
                                    {item.bill.bill.title}
                                </a>
                            </td>
                            <td>{item.bill.bill.number}</td>
                            <td>{item.bill.bill.congress}</td>
                            <td>{item.bill.actionDate}</td>
                            <td>{item.bill.actionDesc}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

